import React from "react";

export default function Navbar() {
  return (
    <nav>
      <h1 className="logo">RajuTK</h1>
      <div className="links">
        <Link to="/contact"></Link>
        <Link to="/about"></Link>
      </div>
    </nav>
  );
}
